import React from "react";
import Country from "./Country";
import Loading from "./Loading";
import { useGlobalContext } from "../context";

const CountryList = () => {
  const { countries, loading } = useGlobalContext();
  console.log(countries);
  if (loading) {
    return <Loading />;
  }
  if (countries.length < 1) {
    return (
      <h2 className="section-title">no country matched your search criteria</h2>
    );
  }
  return (
    <section className="section">
      <h2 className="section-title">cocktail</h2>
      <div className="country-center">
        {countries.map((item) => {
          return <Country key={item.id} {...item} />;
        })}
      </div>
    </section>
  );
};

export default CountryList;
